        //     </div>
        //     <div className='Div-img-con'>
        //         {images.map((img, index) => (
        //             <div key={index} className='Div-img-box' style={{ display: 'flex', flexDirection: 'column', justifyContent: 'space-between', marginRight:'10px', marginTop: '10px'}}>
        //                 <img src={img.path} alt={img.filename} className='Image-style' />
        //                 <div key={index} style={{ background: 'snow', borderBottomLeftRadius: '30px',  borderBottomRightRadius: '30px', height: '80px'}}>
        //                 <div key={index} className='' style={{marginTop: '15px'}}>
        //                     <p key={index} className='Text-name'>Name : {img.filename}</p>
        //                     <p key={index} className='Text-result'>Result : {img.prediction === 1 ? 'Not Cabinet' : img.prediction === 2 ? 'Standing Cabinet' : 'Lying down Cabinet'}</p>
        //                 </div>
        //                 </div>
        //             </div>
        //         ))}
        //     </div>
        //     <div className='Div-back' style={{position: 'fixed'}}>
        //         <Link to="/show" className="logo">
        //             <img src={logo} alt="" className="Back-ele" style={{}}/>
        //             <p className='Back-text' style={{position: 'fixed'}}>back</p>
        //         </Link>
        //     </div>
        // </div>
        <div>
        <p>Standing Co</p>
        <div className="prediction-report">
            <h2>Prediction Report</h2>
            <div className="prediction-grid">
                {images.map((img, index) => (
                    <div key={index} className="prediction-card">
                        <img src={img.path} alt={img.filename} className="image-placeholder"/>
                        <div className="button-container">
                            <div
                                className="circle-button"
                            >
                                <img src={logosearch} alt="logo" style={{ width: '15px', cursor: 'pointer' }} />
                            </div>
                        </div>
                        <div className="prediction-info" >
                            <p>
                                <strong>name :</strong> {img.filename || '-'}
                            </p>
                            <p>
                                <strong>prediction result :</strong> {img.prediction === 1 ? 'Not Cabinet' : img.prediction === 2 ? 'Standing Cabinet' : 'Lying down Cabinet' || '-'}
                            </p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
        </div>
    );
};

export default ShowST;
